import React, { useState } from "react";
import "./App.css";
import Utility from "./function/utility"
import LoginPage from "./pages/LoginPage";

export default function App() {

  const [user, setUser] = useState([]);

  const getUserInfo = (userdata) => {

    setUser(userdata)
  };
  const testFetch = () => {
      Utility.CheckAccessTokenExpiresIn().then((tokenIsExpires) => {
        let request;
        if (tokenIsExpires=== "Access token has expired") {
          console.log(tokenIsExpires);
          request = {
            method: "POST",
            url: "getNew",
            body: JSON.stringify({ test: "tere" }),
            ContentType: "application/json; charset=UTF-8",
            Authorization: `Bearer ${sessionStorage.getItem("accessToken")}`,
          };
          return
        }
       request = {
          method: "POST",
          url: "test",
          body: JSON.stringify({ test: "tere" }),
          ContentType: "application/json; charset=UTF-8",
          Authorization: `Bearer ${1}`,
        };
        Utility.FetchRequest(request)
          .then((result) => {
            console.log(result);
          })
          .catch((err) => {
            if (err.error ==="Unauthorized") {
              Utility.UserUnauthorized()
            }
          });
      }).catch(() => {
        Utility.UserUnauthorized()
      });

  };
  return (
    <div>
      {user.length === 0 ? (
        <div>
          <LoginPage getUserInfo={getUserInfo} />
        </div>
      ) : (
        <div>
       <button onClick={()=>testFetch()}>3232</button>
       </div>
      )}
    </div>
  );
}
